	clone.gotoAndStop(this.currentFrame);
	clone.paused = this.paused;
	clone.framerate = this.framerate;
	return clone;
}
function getMCSymbolPrototype(symbol, nominalBounds, frameBounds) {
	var prototype = cjs.extend(symbol, cjs.MovieClip);
	prototype.clone = mc_symbol_clone;
	prototype.nominalBounds = nominalBounds;
	prototype.frameBounds = frameBounds;
	return prototype;
	}

		// audio components 
		var main = this.main;
		var playBtn = main.playnow;
		var tryBtn = main.tryAgain;
		var text = main.text;
		var scene = main.base1;
		var rec = scene.recruit;
		var sold1 = scene.sold1;
		var sold2 = scene.sold2;
		var mech1 = scene.mech1;
		var mech2 = scene.mech2;
		var mech3 = scene.mech3;
		var car1 = scene.car1;
		var car2 = scene.car2;
		var car3 = scene.car3;
		var cash = 1000;
		var balance = main.ui.money.balance;
		balance.text = cash.toString();
		var hand = main.button.button.hand;
		var btn_mech = main.button.button.mech;
		var btn_vehicle = main.button.button.vehicle;
		var btn_soldier = main.button.button.soldier;
		var carCount = 0;
		var mechCount = 0;
		var soldierLvl = 1;
		text.mcheck.visible = false;
		text.ccheck.visible = false;
		text.scheck.visible = false;
		window.addEventListener('hideUI', function () {
			//hide buttons and checklist
			main.button.gotoAndPlay(18);
			text.gotoAndPlay(90);
		});
		window.addEventListener('showUI', function () {
			musicBG.play();
			main.ui.gotoAndPlay(1);
			main.button.gotoAndPlay(1);
			btn_mech.clickable = true;
			btn_vehicle.clickable = true;
			btn_soldier.clickable = true;
		});
		window.addEventListener('playFail', function () {
			main.gotoAndPlay(95);
			btn_mech.clickable = false;
			btn_vehicle.clickable = false;
			btn_soldier.clickable = false;
		});
		btn_mech.clickable = false;
		btn_vehicle.clickable = false;
		btn_soldier.clickable = false;
		btn_mech.addEventListener('click', mechClick);
		btn_vehicle.addEventListener('click', vehicleClick);
		btn_soldier.addEventListener('click', soldierClick);
		window.addEventListener('makeClickableV', function () {
			if (cash >= 400) {
				btn_vehicle.clickable = true;
			}
		});
		window.addEventListener('makeClickableS', function () {
			btn_soldier.clickable = true;
		});
		window.addEventListener('makeClickableM', function () {
			if (cash >= 150) {
				btn_mech.clickable = true;
			}
		});
		function mechClick() {
			if (btn_mech.clickable) {
				hand.visible = false;
				btnSFX.play();
				if (mechCount == 2 && cash >= 150) {
					btn_mech.gotoAndPlay(33);
					mechCount++;
					mech3.gotoAndPlay(1);
					cash -= 150;
					main.ui.money.hl.play();
					balance.text = cash.toString();
					btn_mech.clickable = false;
				}
				if (mechCount == 1 && cash >= 100) {
					btn_mech.gotoAndPlay(17);
					mechCount++;
					mech2.gotoAndPlay(1);
					cash -= 100;
					main.ui.money.hl.play();
					balance.text = cash.toString();
					btn_mech.clickable = false;
					text.mcheck.visible = true;
				} else if (cash < 100) {
					main.ui.gotoAndPlay(30);
				}
				if (mechCount == 0 && cash >= 50) {
					btn_mech.gotoAndPlay(1);
					mechCount++;
					mech1.gotoAndPlay(1);
					cash -= 50;
					main.ui.money.hl.play();
					balance.text = cash.toString();
					btn_mech.clickable = false;
				}
			}
		}
		function vehicleClick() {
			if (btn_vehicle.clickable) {
				hand.visible = false;
				btnSFX.play();
				if (carCount == 2 && cash >= 400) {
					btn_vehicle.gotoAndPlay(33);
					carCount++;
					car3.gotoAndPlay(1);
					cash -= 400;
					main.ui.money.hl.play();
					balance.text = cash.toString();
					btn_vehicle.clickable = false;
				}
				if (carCount == 1 && cash >= 300) {
					btn_vehicle.gotoAndPlay(17);
					carCount++;
					car2.gotoAndPlay(1);
					cash -= 300;
					main.ui.money.hl.play();
					balance.text = cash.toString();
					btn_vehicle.clickable = false;
					text.ccheck.visible = true;
				}
				if (carCount == 0 && cash >= 200) {
					btn_vehicle.gotoAndPlay(1);
					carCount++;
					car1.gotoAndPlay(1);
					cash -= 200;
					main.ui.money.hl.play();
					balance.text = cash.toString();
					btn_vehicle.clickable = false;
				}
			} else if (carCount < 2 && cash < 300) {
					main.ui.gotoAndPlay(30);
				}
		}
		function soldierClick() {
			if (btn_soldier.clickable) {
				hand.visible = false;
				btnSFX.play();
				if (soldierLvl == 2 && cash >= 200) {
					btn_soldier.gotoAndPlay(17);
					soldierLvl++;
					cash -= 200;
					main.ui.money.hl.play();
					sold2.gotoAndPlay(1);
					balance.text = cash.toString();
					btn_soldier.clickable = false;
					text.scheck.visible = true;
				} else if (cash < 200) {
					main.ui.gotoAndPlay(30);
				}
				if (soldierLvl == 1 && cash >= 150) {
					btn_soldier.gotoAndPlay(1);
					soldierLvl++;
					cash -= 150;
					main.ui.money.hl.play();
					sold1.gotoAndPlay(1);
					balance.text = cash.toString();
					btn_soldier.clickable = false;
				}
			}
		}
		window.addEventListener('checkForComplete', checkForComplete);
